import React, { Component } from 'react';

class Bar extends Component {
    render() {
        return (
            <div className="bar">
                <i class="fa fa-diamond fa-5x"></i>
                <i class="fa fa-map-marker fa-5x"></i>
                <i class="fa fa-car fa-5x "></i>
                

            </div>
        );
    }
}

export default Bar;
